content: >-
  <p class="q1"><span data-number="18" data-sid="PSA 68:18"
  class="v">18</span>Thou hast ascended on high, thou hast led captivity
  captive: thou hast received gifts for men; yea, <span class="add">for</span>
  the rebellious also, that the <span class="nd">LORD</span> God might dwell
  <span class="add">among them</span>.</p>
